import React from "react";

const ProductList = ({ currentPage, cart, setCart, wishlist, setWishlist, showNotification }) => {
  return (
    <section className="py-16 bg-white">
      <div className="container mx-auto px-4">
        <div className="text-center mb-12">
          <h2 className="text-3xl font-bold text-gray-800 mb-2">Our Resin Art Collection</h2>
          <p className="text-gray-600 max-w-2xl mx-auto">[Product filtering and display coming soon]</p>
        </div>
      </div>
    </section>
  );
};

export default ProductList;
